const App=()=>{
    return (
        <HashRouter>
            {/* 由上往下做匹配，匹配到就不會匹配後面的頁面 */}
            <Route exact path='/' component={FirstPage}/>
            <Route path='/second' component={SecondPage}/>
        </HashRouter>
    )
}

export default App;
